import React, { Component } from 'react';
import './main.css';

export default class Main extends Component {
    state = {
        titulo: "Game Fifteen",
        box: [],
        i: "",
    };

    loadBox = () => {
        const { box, i } = this.state;
        for (i = 1; i <= 15; i++) {
            box[i] = i;
            console.log(box[i] + " ");
            this.setState({ box: i });
        }
    };

    render() {
        const { titulo, box } = this.state;
        return (
            <div className="border">
                <h1>
                    {titulo}
                </h1>
                <div className="box">{box.map()}</div>
            </div>
        )
    }
}
